var sorted_theatres;

// in starting sorted theatre and all theatre are same
sorted_theatres = all_theatre;


// function to show the theatres
function showTheatre() {
    const tbody = document.getElementsByTagName('tbody')[0];
    tbody.innerHTML = '';
    for (let i = 0; i < sorted_theatres.length; i++) {
        let tr = document.createElement('tr')
        tr.innerHTML = `
            <td>${sorted_theatres[i][0]}</td>
            <td>${sorted_theatres[i][1]}</td>
            <td>${sorted_theatres[i][2]}</td>
            <td>${sorted_theatres[i][3]}</td>
            <td>${sorted_theatres[i][4]}</td>
            <td>${sorted_theatres[i][5]}</td>
        `
        tbody.appendChild(tr);
    }
    document.getElementById('real-value').innerText = `${sorted_theatres.length}/${all_theatre.length}`
}

// function to filter based on a condition
const filter_theatre = (criteriaType, value) => {
    return sorted_theatres.filter(theatre => {
        const [
            TheatreName,
            ChainName,
            State,
            Pin,
            City,
            CompleteAddress
        ] = theatre;

        if (criteriaType == "Theatre Name") {
            return TheatreName.toLowerCase().includes(value.toLowerCase());
        } else if (criteriaType == 'Chain Name') {
            return ChainName.toLowerCase().includes(value.toLowerCase());
        } else if (criteriaType == 'State') {
            return State.toLowerCase().includes(value.toLowerCase());
        } else if (criteriaType == 'Pin') {
            return Pin.toLowerCase().includes(value.toLowerCase());
        } else if (criteriaType == 'City') {
            return City.toLowerCase().includes(value.toLowerCase());
        } else if (criteriaType == 'Complete Address') {
            return CompleteAddress.toLowerCase().includes(value.toLowerCase());
        }
        return false

    });
};

