var pinValue = url.searchParams.get('pinValue');
var cityValue = url.searchParams.get('cityValue');
var addressValue = url.searchParams.get('addressValue');

const theatreNameFilter = document.getElementById('theatreNameFilter');
const chainNameFilter = document.getElementById('chainNameFilter');
const stateFilter = document.getElementById('stateFilter');
const pinFilter = document.getElementById('pinFilter');
const addressFilter = document.getElementById('addressFilter');
