function addAllFilter(theatre, chian, state, pin, city, address) {

    theatreNameFilter.value = theatre;
    chainNameFilter.value = chian;
    stateFilter.value = state;
    pinFilter.value = pin;
    cityFilter.value = city;
    addressFilter.value = address;

    if (theatre == null) {
        theatre = "";
    }
    if (chian == null) {
        chian = "";
    }
    if (state == null) {
        state = "";
    }
    if (pin == null) {
        pin = "";
    }
    if (city == null) {
        city = "";
    }
    if (address == null) {
        address = "";
    }

    sorted_theatres = filter_theatre('Theatre Name', theatre)
    console.log('theatre', sorted_theatres.length)
    sorted_theatres = filter_theatre('Chain Name', chian)
    sorted_theatres = filter_theatre('State', state)
    sorted_theatres = filter_theatre('Pin', pin)
    sorted_theatres = filter_theatre('City', city)
    sorted_theatres = filter_theatre('Complete Address', address)
}

addAllFilter(theatreName, chianValue, stateValue, pinValue, cityValue, addressValue)

